export const History = () => {

  const orders = useSelector(selectAllOrders)
// console.log(JSON.parse(orders[0]));
// console.log( orders[0].order);
const newOrder = async () => {
  const hello = await JSON.parse(orders[0].order)
  console.log(hello);
} 
newOrder()
